import React from 'react';
import './technologies.scss';

import Wordpress from './assets/wordpress-logo.png';

const Technologies = () => {
    return (
        <div className="technologies">
            <div className="row">
                <div className="col-12">
                    <h2 className="text-center mt-5">Technologies Used</h2>
                </div>
                <div className="col-6 text-center parragraph">
                    <p>Our developer team is constantly improving their skills to apply them in future projects.</p>
                </div>
                <div className="col-6">
                    <div className="col-4">
                        <div className="card">
                            <img className="img-fluid" src={Wordpress} alt="wordpress-logo"/>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Technologies;
